import { BrowserRouter, Routes, Route } from "react-router-dom";

import { HOME } from "./constants";

import Home from "../pages/Home";

const Router = () => (
  <BrowserRouter>
    <Routes>
      <Route path={HOME} element={<Home />} />
      <Route path="/" element={<Home />} />
    </Routes>
  </BrowserRouter>
);

export default Router;
